import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Footer extends Component {
    render() {
      return (
        <div className="footer">
          <nav>
            <ul>
            "본 저작물은 '건강보험심사평가원'에서 '15년'작성하여 공공누리 제1유형으로 개방한 '병원정보서비스(작성자:유보라)'을 이용하였으며,
해당 저작물은 '보건의료빅데이터개방시스템,https://opendata.hira.or.kr/op/opc/selectOpnsApi.do?divCd=&searchCnd=&searchWrd=&sno=713&pageIndex=1'에서 무료로 다운받으실 수 있습니다."
            </ul>
          </nav>
        </div>
      )
    }
}

export default Footer;
